(594, '2023-02-01 07:31:22', '2023-01-28', '2023-03-20', 9474, NULL, NULL, 0, 0, 0, 'founder of Buddha, ', '1815 Battle of Waterloo: the Napoleonic Empire ends, and with it Napoleon’s ambition to rule and reform all of Europe.\r\n        1918 End of the First World War. The Habsburg and Ottoman empires collapse; maps of Europe and the Middle East are redrawn.\r\n        ', 46),
(595, '2023-02-01 07:31:22', '2023-01-29', '2023-03-03', 49814, 67121, 'Jermaine Buck', 2, 0, 0, 'and Empire:  ', '1453 Fall of Constantinople to the Ottoman Turks: Almost 500 years of Turkish domination of the Eastern Mediterranean, North Africa and the Middle East begins.\r\n        1519 Cortes begins his conquest of South America, which becomes part of the wider world economic and political system.\r\n        ', 47),
(596, '2023-02-01 07:31:22', '2022-12-08', '2022-12-28', 2086, NULL, NULL, 0, 0, 0, 'petrol-driven starting most develops', '1564 William Shakespeare is born: his plays make fundamental statements about the human condition.\r\n        1687 Isaac Newton publishes Principia Mathematica, the foundation of modern physics.\r\n        ', 47),
(597, '2023-02-01 07:31:22', '2022-12-31', '2023-02-24', 18087, 95856, 'Ruben Powers', 2, 1, 1, 'land   ', 'c.5 BC Birth of Jesus Christ, founder of the many branches of Christianity. The exact date is disputed.\r\n        1815 Battle of Waterloo: the Napoleonic Empire ends, and with it Napoleon’s ambition to rule and reform all of Europe.\r\n        ', 47),
(598, '2023-02-01 07:31:22', '2023-03-09', '2023-04-07', 41908, 17559, 'Cayden Cherry', 1, 0, 0, 'Bologna, Italy: the conception', '1054 Schism of Greek and Latin Christian Churches divides Christianity permanently into two geographical and denominational halves.\r\n        c.3000 BC Founding of the first cities in Sumeria (present-day Iraq): origin of modern social and administrative structures.\r\n        ', 47),
(599, '2023-02-01 07:31:22', '2023-05-15', '2023-06-11', 49329, 75567, 'Esteban Burke', 5, 0, 0, 'and is Foundation warfare.\r\n', '1945 End of Second World War; when the first nuclear bomb is detonated, mankind develops the means to destroy itself.\r\n        c.1600 BC Modern alphabet invented: the essential means of communication of complex concepts and culture.\r\n        ', 47),
(600, '2023-02-01 07:31:22', '2022-12-12', '2023-01-16', 4070, 77166, 'Taylor Rivas', 2, 0, 0, ' secure expansion Roman', '1815 Battle of Waterloo: the Napoleonic Empire ends, and with it Napoleon’s ambition to rule and reform all of Europe.\r\n        753 BC Foundation of Rome: the Roman Empire is a pillar of the modern age, producing ideas on justice, law, engineering and warfare.\r\n        ', 47),
(601, '2023-02-01 07:31:22', '2023-04-01', '2023-05-30', 23676, 28265, 'Gracelyn Peters', 1, 0, 0, 'China China China 1949', 'AD 476 Fall of the Roman Empire in the West ends 800 years of Roman hegemony. The creation of moderen Europe begins.\r\n        1959 Invention of the silicon chip is the major technical invention of the past century, making possible the computer age.\r\n        ', 47),
(602, '2023-02-01 07:31:22', '2023-04-23', '2023-06-01', 39598, 84331, 'Adalynn Baxter', 2, 0, 1, 'start  the ', '202 BC Hannibal is defeated by Rome: the victory is essential to secure the survival and expansion of Roman civilisation.\r\n        27 BC Founding of the Roman Empire: this is the start of the classic period of Roman domination in Europe and the Mediterranean.\r\n        ', 47),
(603, '2023-02-01 07:31:22', '2023-01-11', '2023-03-02', 6314, 74812, 'Ben Prince', 1, 1, 0, 'Europe.\r\n   Christianity', 'AD 800 Charlemagne crowned Emperor of the new Western Empire. This marked the point at which Europe began to reintegrate. The Holy Roman Empire lasts for 1,000 years.\r\n        c.5 BC Birth of Jesus Christ, founder of the many branches of Christianity. The exact date is disputed.\r\n        ', 47),
(604, '2023-02-01 07:31:22', '2023-02-08', '2023-03-17', 8650, 56288, 'Jaida Huerta', 3, 0, 0, 'civilisation:  Greek and', '1519 Cortes begins his conquest of South America, which becomes part of the wider world economic and political system.\r\n        1918 End of the First World War. The Habsburg and Ottoman empires collapse; maps of Europe and the Middle East are redrawn.\r\n        ', 47),
(605, '2023-02-01 07:31:22', '2022-12-06', '2022-12-30', 14743, 59422, 'Carmelo Browning', 2, 0, 0, '   of', 'AD 800 Charlemagne crowned Emperor of the new Western Empire. This marked the point at which Europe began to reintegrate. The Holy Roman Empire lasts for 1,000 years.\r\n        1492 Christopher Columbus discovers the New World, bringing the Americas into a global trading/cultural system.\r\n        ', 47);
